import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import axiosinstance from './axiosInstance';

function Register() {
    const [userData, setUserData] = useState({
        username: '',
        password: '',
        name: '',
        email: '',
        balance: '',
        salary: '',
        rent: '',
        age: ''
    });

    const [message, setMessage] = useState({ text: '', type: '' });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
    
        setUserData((prevData) => ({
            ...prevData,
            [name]: ["balance", "salary", "rent", "age"].includes(name)
                ? (value === '' ? '' : parseFloat(value)) // Convert to number for numeric fields
                : value
        }));
    };
    
    const handleRegister = async (e) => {
        e.preventDefault();
        try {
            // Prepare the payload (just to ensure numeric values are correct)
            const payload = {
                ...userData,
                balance: parseFloat(userData.balance),
                salary: parseInt(userData.salary),
                rent: parseInt(userData.rent),
                age: parseInt(userData.age)
            };
    
            console.log('Payload being sent:', payload);
    
            const response = await axiosinstance.post('/register', payload);
            console.log('Response from server:', response);
    
            if (response.status === 201 || response.status === 200) {
                setMessage({ text: 'Registration successful!', type: 'success' });
    
                // Reset form
                setUserData({
                    username: '',
                    password: '',
                    name: '',
                    email: '',
                    balance: '',
                    salary: '',
                    rent: '',
                    age: ''
                });
            }
        } catch (error) {
            console.error('Error response:', error.response);
            setMessage({
                text:
                    error.response?.data?.message || 'Failed to register. Please check your inputs and try again.',
                type: 'error'
            });
        }
    };
    
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                    <h2 className="text-center m-4">Register User</h2>
                    {message.text && (
                        <div
                            className={`alert ${
                                message.type === 'success' ? 'alert-success' : 'alert-danger'
                            } text-center`}
                        >
                            {message.text}
                        </div>
                    )}

                    <form onSubmit={handleRegister}>
                        <div className="mb-3">
                            <label htmlFor="username" className="form-label">
                                Username
                            </label>
                            <input
                                type="text"
                                className="form-control"
                                name="username"
                                placeholder="Enter username"
                                value={userData.username}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="password" className="form-label">
                                Password
                            </label>
                            <input
                                type="password"
                                className="form-control"
                                name="password"
                                placeholder="Enter password"
                                value={userData.password}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="name" className="form-label">
                                Name
                            </label>
                            <input
                                type="text"
                                className="form-control"
                                name="name"
                                placeholder="Enter full name"
                                value={userData.name}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="email" className="form-label">
                                Email
                            </label>
                            <input
                                type="email"
                                className="form-control"
                                name="email"
                                placeholder="Enter email"
                                value={userData.email}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="balance" className="form-label">
                                Balance
                            </label>
                            <input
                                type="number"
                                step="0.01"
                                className="form-control"
                                name="balance"
                                placeholder="Enter balance"
                                value={userData.balance}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="salary" className="form-label">
                                Salary
                            </label>
                            <input
                                type="number"
                                className="form-control"
                                name="salary"
                                placeholder="Enter salary"
                                value={userData.salary}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="rent" className="form-label">
                                Rent
                            </label>
                            <input
                                type="number"
                                className="form-control"
                                name="rent"
                                placeholder="Enter rent"
                                value={userData.rent}
                                onChange={handleInputChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="age" className="form-label">
                                Age
                            </label>
                            <input
                                type="number"
                                className="form-control"
                                name="age"
                                placeholder="Enter age"
                                value={userData.age}
                                onChange={handleInputChange}
                                required
                            />
                        </div>

                        <button type="submit" className="btn btn-outline-primary">
                            Register
                        </button>
                        <Link className="btn btn-outline-danger mx-2" to="/">
                            Cancel
                        </Link>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Register;
